export const Products = (props) => {
  const infos = props.items.slice(0, props.offset * 5);

  return (
    <div>
      {infos &&
        infos.map((item) => (
          <div key={item.carClassId}>
            <img src={item.image} alt={`${item.carClassNfame} 차량`} />
            <p>{item.carClassName}차량 이름</p>

            <p>{item.price}원</p>
            <p>{item.discountPercent}%</p>

            <p>{item.carTypeTags}차량태그</p>
            <p>{item.year}년</p>
            <p>{item.drivingDistance}km</p>
            <p>{item.regionGroups}</p>
          </div>
        ))}
    </div>
  );
};

export default Products;
